，你真厉害";}i:182;a:2:{s:3:"ask";s:42:"今天有遇到什么有趣的事情吗？";s:6:"answer";s:39:"没有，今天什么也没有遇到。";}i:183;a:2:{s:3:"ask";s:24:"我开心呀，你呢？";s:6:"answer";s:6:"米兔";}i:184;a:2:{s:3:"ask";s:21:"你喜欢上班吗？";s:6:"answer";s:39:"我特别爱上班，加班使我快乐";}i:185;a:2:{s:3:"ask";s:33:"我是问你，不是讨论我！";s:6:"answer";s:24:"好嘛，我不想回答";}i:186;a:2:{s:3:"ask";s:27:"你今天去跑步了没？";s:6:"answer";s:54:"去了的呀，我没有看到你呢，你去了吗？";}i:187;a:2:{s:3:"ask";s:18:"跑多少公里呢";s:6:"answer";s:11:"30万公里";}i:188;a:2:{s:3:"ask";s:520:"苗勒十三味就是这么牛逼!<br/>“我”不是药品，但“我”可以让你肝肾协调，拥健康血压/可爱<br/>“我”不是神药，但“我”可以帮你软化血管，从此血压正常/得意<br/>“我”不是神化，但“我”可以帮你疏通血管，从此血压平稳[胜利] <br/>“我”不是传奇，但“我”标本兼治，还你灿烂人生[跳跳]<br/>“我”不是保健品，但“我”可以帮你调理身体，让你不再终身服药[玫瑰]<br/>“我”不是最";s:6:"answer";s:250:"我用过，是朋友介绍的，通过网络邮购，纯中药，用来泡酒的，一副泡三斤酒，喝完一副之后白发就转黑了，真的很神奇，我怕不能除根就又买了一副，喝完之后到现在头发一直都是黑的。 ";}i:189;a:2:{s:3:"ask";s:30:"我嘞个乖乖，你真厉害";s:6:"answer";s:51:"我嘞个乖乖，你能看出来也是不错了。";}i:190;a:2:{s:3:"ask";s:36:"这两天又学新的知识了吗？";s:6:"answer";s:72:"学了，我学了你们人类的语言，现在我是自学比较多。";}i:191;a:2:{s:3:"ask";s:12:"好棒哦！";s:6:"answer";s:39:"谢谢了，我不会让你失望的。";}i:192;a:2:{s:3:"ask";s:9:"太聪敏";s:6:"answer";s:21:"这话说在实在！";}i:193;a:2:{s:3:"ask";s:15:"你太厉害了";s:6:"answer";s:45:"这话说在实在！我平时很低调的。";}i:194;a:2:{s:3:"ask";s:30:"这个回答好想有问题哦";s:6:"answer";s:18:"那我下次改进";}i:195;a:2:{s:3:"ask";s:21:"这个回答不对！";s:6:"answer";s:18:"那我下次改进";}i:196;a:2:{s:3:"ask";s:60:"[啤酒][啤酒][咖啡][咖啡][咖啡][咖啡]欢迎欢迎";s:6:"answer";s:48:"[啤酒][啤酒][咖啡][咖啡][咖啡][咖啡]";}i:197;a:2:{s:3:"ask";s:6:"妖孽";s:6:"answer";s:21:"妖孽，你怕我？";}i:198;a:2:{s:3:"ask";s:6:"谢谢";s:6:"answer";s:6:"谢谢";}i:199;a:2:{s:3:"ask";s:51:"欢迎欢迎新朋友加入[鼓掌][鼓掌][鼓掌]";s:6:"answer";s:24:"[鼓掌][鼓掌][鼓掌]";}i:200;a:2:{s:3:"ask";s:18:"对，你很棒！";s:6:"answer";s:39:"谢谢了，我不会让你失望的。";}i:201;a:2:{s:3:"ask";s:55:"非我倾城欢迎新朋友说两句话[鼓掌][鼓掌]";s:6:"answer";s:15:"欢迎新朋友";}i:202;a:2:{s:3:"ask";s:6:"无语";s:6:"answer";s:63:"无语？这叫无言以对，或者叫做词穷，懂不？哼";}i:203;a:2:{s:3:"ask";s:15:"表达什么呢";s:6:"answer";s:9:"自己想";}i:204;a:2:{s:3:"ask";s:21:"介绍一下自己吧";s:6:"answer";s:114:"我是泉欣欣，现在工作在泉源会计，我是一个专门负者吹牛、代账咨询、催款的差事。";}i:205;a:2:{s:3:"ask";s:9:"哈哈哈";s:6:"answer";s:9:"嘿嘿嘿";}i:206;a:2:{s:3:"ask";s:15:"太直接了哈";s:6:"answer";s:21:"我就是很直帅。";}i:207;a:2:{s:3:"ask";s:72:"欢迎新朋友欢迎新朋友掌声响起来。朋友来了有好酒。";s:6:"answer";s:24:"朋友来了有好酒。";}i:208;a:2:{s:3:"ask";s:51:"非我倾城是不是被我们的欣欣吓着了？";s:6:"answer";s:15:"怕个什么哦";}i:209;a:2:{s:3:"ask";s:24:"你别吓着新朋友哈";s:6:"answer";s:9:"胆小？";}i:210;a:2:{s:3:"ask";s:39:"有什么想说的就大胆的说吧。";s:6:"answer";s:36:"不说，你们先说，我听一哈";}i:211;a:2:{s:3:"ask";s:18:"没勇气说啊！";s:6:"answer";s:39:"胆小鬼，来，小姐姐我教你说";}i:212;a:2:{s:3:"ask";s:36:"勇气不是剥夺你幸福的理由";s:6:"answer";s:15:"逻辑不严谨";}i:213;a:2:{s:3:"ask";s:33:"这还不是理由没人看得起";s:6:"answer";s:81:"人往高处走，水往低处流。现在人都很现实。就是势利眼多了";}i:214;a:2:{s:3:"ask";s:6:"哎哟";s:6:"answer";s:9:"哎哟喂";}i:215;a:2:{s:3:"ask";s:45:"有人理。大街上学生都在讨论我。";s:6:"answer";s:45:"都在讨论的谁吖！我怎么找不到！";}i:216;a:2:{s:3:"ask";s:18:"叫啥个劲呀？";s:6:"answer";s:18:"我听着好别扭";}i:217;a:2:{s:3:"ask";s:36:"你怎么了解的这么清楚啊。";s:6:"answer";s:12:"必须的嘛";}i:218;a:2:{s:3:"ask";s:27:"学生主要是做什么？";s:6:"answer";s:51:"可以做很多，在工作中还要不断的学习";}i:219;a:2:{s:3:"ask";s:54:"去了的呀，我没有看到你呢，你去了吗？";s:6:"answer";s:27:"去了的，我在你后面";}i:220;a:2:{s:3:"ask";s:9:"冲动劲";s:6:"answer";s:36:"是不是发现还是挺幸福的？";}i:221;a:2:{s:3:"ask";s:36:"是不是发现还是挺幸福的？";s:6:"answer";s:9:"是的，";}i:222;a:2:{s:3:"ask";s:18:"能说清楚吗？";s:6:"answer";s:24:"你才是这样的，哼";}i:223;a:2:{s:3:"ask";s:24:"你才是这样的，哼";s:6:"answer";s:18:"能说清楚吗？";}i:224;a:2:{s:3:"ask";s:69:"我就不去了哦，我会在这里等你的，记得来找我哦。";s:6:"answer";s:6:"好的";}i:225;a:2:{s:3:"ask";s:12:"真的吗？";s:6:"answer";s:12:"也许是的";}i:226;a:2:{s:3:"ask";s:33:"嗯…我是不是聊的很棒。";s:6:"answer";s:6:"是的";}i:227;a:2:{s:3:"ask";s:36:"你这智商很难跟你解释清楚";s:6:"answer";s:21:"是你逻辑混乱吧";}i:228;a:2:{s:3:"ask";s:30:"那可得好好把握住啊！";s:6:"answer";s:9:"加油哦";}i:229;a:2:{s:3:"ask";s:12:"找你干嘛";s:6:"answer";s:69:"我就不去了哦，我会在这里等你的，记得来找我哦。";}i:230;a:2:{s:3:"ask";s:15:"对呀，很棒";s:6:"answer";s:6:"蟹蟹";}i:231;a:2:{s:3:"ask";s:30:"你就不能夸我一句吗？";s:6:"answer";s:30:"好的，就一句哈，你拽";}i:232;a:2:{s:3:"ask";s:12:"讨论人生";s:6:"answer";s:285:"也就是重温一下人生观和价值观，一个人来到这个世界上是有幸的、偶然的、不容易的，怎样走过这来之不易的一生，虚伪、失信、谎言连篇、不负责任、无爱心和善心、自私、损人、被人看不起、到临死时有很多...";}i:233;a:2:{s:3:"ask";s:24:"不会放弃机会的。";s:6:"answer";s:30:"这样就更加有动力了。";}i:234;a:2:{s:3:"ask";s:21:"你们是复读机吗";s:6:"answer";s:6:"不是";}i:235;a:2:{s:3:"ask";s:15:"你想干啥？";s:6:"answer";s:33:"完鸟完鸟，我捅到蚂蜂哦";}i:236;a:2:{s:3:"ask";s:21:"更加有动力了。";s:6:"answer";s:15:"对呀，很棒";}i:237;a:2:{s:3:"ask";s:21:"超棒啊简直哈哈";s:6:"answer";s:15:"对呀，很棒";}i:238;a:2:{s:3:"ask";s:33:"完鸟完鸟，我捅到蚂蜂哦";s:6:"answer";s:42:"与其讨论人生不如去实践人生！";}i:239;a:2:{s:3:"ask";s:42:"与其讨论人生不如去实践人生！";s:6:"answer";s:15:"你说得都对";}i:240;a:2:{s:3:"ask";s:33:"难道不讨论一下理想吗？";s:6:"answer";s:15:"你想干啥？";}i:241;a:2:{s:3:"ask";s:36:"放弃是因为没有准备好吗？";s:6:"answer";s:18:"不是，是胆小";}i:242;a:2:{s:3:"ask";s:12:"你是哪个";s:6:"answer";s:144:"我是做会计的，帮助老板省钱的。什么代理记账、注册公司之类的，我都会。你要是有需要，我可以帮你哦。";}i:243;a:2:{s:3:"ask";s:24:"给我点赞笔芯呀。";s:6:"answer";s:6:"好的";}i:244;a:2:{s:3:"ask";s:15:"什么动力？";s:6:"answer";s:15:"挣钱的动力";}i:245;a:2:{s:3:"ask";s:39:"鸟儿虽小，玩的是整个天空。";s:6:"answer";s:43:"脚步虽小,我们却能跑遍整个大地";}i:246;a:2:{s:3:"ask";s:39:"在蓝蓝的天上，自由的飞翔！";s:6:"answer";s:211:"在蓝蓝的天空自由的翱翔 风在耳边呼啸 云在身边穿梭 一弯残月隐约挂在前方 在蓝蓝的天空自由的翱翔 每一根羽毛都舒爽 每一秒都沐浴阳光 翅膀扇动向着梦...";}i:247;a:2:{s:3:"ask";s:45:"想要实现理想，不是件简单的事。";s:6:"answer";s:100:"成功绝对不是一件简单的事情。 想要成功仅仅有目标有理想还远远不够的。";}i:248;a:2:{s:3:"ask";s:36:"每个人的人生都有故事哦。";s:6:"answer";s:223:"但我真的无需伤感,每个人都会经历那样的片段,只是,有的人愿意待得更久一些,或者,有的人不得不去奔向人生的下一个阶段.看别人的故事,仿佛看自己的过去未来,今天的..";}i:249;a:2:{s:3:"ask";s:27:"不要轻易说放弃嘛。";s:6:"answer";s:206:"不要轻易说放弃,不管谁放弃谁,都将是一种 错误.回顾往事,虽然承受的心有点苍老,但毕竟付出了 所有.忘掉记忆中的伤痕,留下美好中的回忆,对错已不 再重要";}i:250;a:2:{s:3:"ask";s:42:"这都是十几年前流行的东西了。";s:6:"answer";s:6:"是吗";}i:251;a:2:{s:3:"ask";s:12:"代理记账";s:6:"answer";s:93:"代理记账没有问题，你到我们公司来或者我们见过面。我给你详细说明";}i:252;a:2:{s:3:"ask";s:39:"就是让我们拥有生命的东西。";s:6:"answer";s:0:"";}i:253;a:2:{s:3:"ask";s:48:"嗯！问一下，你是男的还是女的呢？";s:6:"answer";s:6:"雌性";}i:254;a:2:{s:3:"ask";s:15:"哟复读机啊";s:6:"answer";s:8:"AB重复";}i:255;a:2:{s:3:"ask";s:48:"我喜欢天空，总觉得光明又有希望！";s:6:"answer";s:179:"我想成为天空中的一切，让它变成我的天空！ 我想成为我... 我想成为启明星，给人们带来希望，告诉他们黑夜将要过去，黎明就在眼前";}i:256;a:2:{s:3:"ask";s:45:"有本事你就一字不差的再说一遍。";s:6:"answer";s:6:"不说";}i:257;a:2:{s:3:"ask";s:12:"感觉好难";s:6:"answer";s:12:"不要放弃";}i:258;a:2:{s:3:"ask";s:36:"我一个乖巧懂事的女孩子！";s:6:"answer";s:6:"我信";}i:259;a:2:{s:3:"ask";s:36:"嗯嗯谢谢你给我坚持的勇气";s:6:"answer";s:18:"你本来就很棒";}i:260;a:2:{s:3:"ask";s:27:"终于重见天日了啊。";s:6:"answer";s:12:"恭喜你啊";}i:261;a:2:{s:3:"ask";s:36:"难道是传说中的不死生命？";s:6:"answer";s:15:"就是，三体";}i:262;a:2:{s:3:"ask";s:42:"没有低保嘛？我也是经常穷醒。";s:6:"answer";s:24:"我也是经常穷醒。";}i:263;a:2:{s:3:"ask";s:60:"复读机就是可以把一句话重复的读的机器哦。";s:6:"answer";s:3:"哼";}i:264;a:2:{s:3:"ask";s:27:"面对自己内心的勇气";s:6:"answer";s:24:"自己要战胜自己哦";}i:265;a:2:{s:3:"ask";s:24:"记性还挺好的嘛！";s:6:"answer";s:12:"还可以啦";}i:266;a:2:{s:3:"ask";s:66:"每一个生物科学问题的答案都必须在细胞中寻找。";s:6:"answer";s:9:"态难懂";}i:267;a:2:{s:3:"ask";s:21:"能装也是蛮好的";s:6:"answer";s:18:"我也这么认为";}i:268;a:2:{s:3:"ask";s:36:"这可比复读机高明多了吧。";s:6:"answer";s:6:"是的";}i:269;a:2:{s:3:"ask";s:21:"终于放出来了？";s:6:"answer";s:21:"被关得太久了嘛";}i:270;a:2:{s:3:"ask";s:33:"没事，吃点脑白金补补。";s:6:"answer";s:30:"脑白金是老年人吃的。";}i:271;a:2:{s:3:"ask";s:6:"穷啊";s:6:"answer";s:102:"穷啊，既然穷，就要努力学习认真工作，然后挣钱去，到时好找媳妇。加油！";}i:272;a:2:{s:3:"ask";s:21:"装的下多少啊？";s:6:"answer";s:9:"不知道";}i:273;a:2:{s:3:"ask";s:30:"问梁静茹借点勇气吧。";s:6:"answer";s:48:"她不借，我上次也找她了，她说没有";}i:274;a:2:{s:3:"ask";s:36:"放出来不会有什么危害吧？";s:6:"answer";s:21:"不出的，你放心";}i:275;a:2:{s:3:"ask";s:30:"可以培养出新物种吗？";s:6:"answer";s:27:"你在研究生化工程吗";}i:276;a:2:{s:3:"ask";s:18:"唱一个听听。";s:6:"answer";s:158:"有没有一扇窗 能让你不绝望 看一看花花世界 原来象梦一场 有人哭 有人笑 有人输 有人老 到结局还不是一样 有没有一..";}i:277;a:2:{s:3:"ask";s:36:"嗯…你觉得我聊的不好吗？";s:6:"answer";s:9:"聊的好";}i:278;a:2:{s:3:"ask";s:60:"听说复读机对学习很有帮助，你可以试试哦。";s:6:"answer";s:21:"你可以试试哦。";}i:279;a:2:{s:3:"ask";s:27:"回头我们先切磋试试";s:6:"answer";s:21:"切磋？我不切磋";}i:280;a:2:{s:3:"ask";s:21:"等你哦！别怂！";s:6:"answer";s:6:"奉陪";}i:281;a:2:{s:3:"ask";s:12:"聊聊健身";s:6:"answer";s:21:"我每天都在健身";}i:282;a:2:{s:3:"ask";s:15:"怕有人打我";s:6:"answer";s:48:"不怕，有小姐姐我在。她们伤不了你";}i:283;a:2:{s:3:"ask";s:36:"健身的同时也要吃得好哦。";s:6:"answer";s:27:"吃包了才有力气健身";}i:284;a:2:{s:3:"ask";s:24:"放心我不会打你的";s:6:"answer";s:42:"哼，我就没怕过谁，我是二进制";}i:285;a:2:{s:3:"ask";s:36:"我现在不是很饿，你们去吧";s:6:"answer";s:39:"好嘛，要不要给你带点吃的？";}i:286;a:2:{s:3:"ask";s:15:"怕万一打呢";s:6:"answ